function generatePDF(){
	var doc = new jsPDF()
	var height=77;
	var lineHeight= 80;
	var sessionContact = JSON.parse(sessionStorage.getItem("contact"));
	var imgData = "data:image/png;base64,";
	doc.addImage(imgData, 'PNG', 20,05);
	
	doc.setFontSize(30);
	doc.text(150, 15, 'Quotation');
	doc.setFontSize(10);
	doc.text(150, 25, 'Order Id:'+sessionContact.orderId);
	
	doc.setFontSize(10);
	doc.text(150, 40, 'Shipped From');
	doc.text(150, 45, 'xxxxxxxxx');
	doc.text(150, 50, 'info@yyyyy.com');
	doc.text(150, 55, '999999999' );
	doc.text(150, 60, 'yyyyy,');
	doc.text(150, 65, 'zzzzzz');
	
	doc.text(20, 40, 'Delivery To');
	doc.text(20, 45, 'Name   :'+sessionContact.name);
	doc.text(20, 50, 'Email  :'+sessionContact.email);
	doc.text(20, 55, 'Phone  :'+sessionContact.phone);
	doc.text(20, 60, 'Address:'+sessionContact.address);
	
	doc.setLineWidth(0.5);
	doc.line(20, 70, 180, 70);
	doc.text(20,height,'Sno');
	doc.text(40,height,'Products');
	doc.text(70,height,'Quantity');
	doc.text(100,height,'Units');
	doc.text(135,height,'Description');
	doc.line(20, lineHeight, 180, lineHeight);
	
    var itrLen = getHighestOfCart();
    var j=1;
    for(var i=1;i<=itrLen;i++){
        var session = sessionStorage.getItem("cartVal"+i);
        var cartObj = JSON.parse(session);
        if(cartObj!=null){
        	height=height+10;
    		lineHeight=lineHeight+10;
    		doc.text(20,height,""+j);
    		j=j+1;
    		doc.text(40,height,cartObj.product);
    		doc.text(70,height,cartObj.quantity);
    		doc.text(100,height,cartObj.units);
    		doc.text(135,height,cartObj.diameter);
    		doc.line(20, lineHeight, 180, lineHeight);
	         
        }
    }
    doc.setTextColor(255, 0, 0);
    doc.setLineWidth(0.25);
    doc.line(20, 280, 180, 280);
    doc.setFontSize(10);
    doc.text(45, 285, "Contact us for payment, kindly get our original invoice after making payment");
    doc.text(65, 290, "yyyyyyyyyyyyyyyyyyy");
    
    var reader = new FileReader();

    reader.onload = function(readerEvt) {
        var binaryString = readerEvt.target.result;
        //window.open( "data:application/pdf;base64,"+btoa(binaryString));
    };
    
    
    reader.readAsBinaryString(doc.output('blob'));

	doc.save('Quotation.pdf')
}
